/* eslint-disable */
import styled from 'styled-components';

const StyledHeader = styled.h2(
    ({hasChanged}) => `
    color: ${hasChanged ? 'purple' : 'black'};
`)

const Header = (props) => {
    const { children, listUnSaved} = props;
    return <StyledHeader listUnSaved={listUnSaved}>{children}</StyledHeader>
}

export default Header;
